window.bookSummaryJSON = "<p><b>From </b><b><i>New York Times</i></b><b> best-selling author Monica Murphy comes an angst-filled new adult romance featuring Drew + Fable’s (</b><b><i>One Week Girlfriend</i></b><b>) daughter, Autumn Callahan!&nbsp;</b></p> <p>My first crush.&nbsp;</p> <p>My first kiss.&nbsp;</p> <p>The boy who ripped my heart out of my chest again and again. Over and over. I let him have it every single time.&nbsp;</p> <p>Willingly.&nbsp;</p> <p>We are that toxic high school couple you hear about, the one you witness in the hallway as they avoid each other. You laugh at them in class when they’re forced to work together, their gazes full of hatred. We are the couple you gossip about when they win homecoming prince and princess their sophomore year....</p> <p>The back and forth is what kills me the most. I’m not his princess, I’m the girl he toys with when he’s bored. And he’s definitely not my prince, no matter how badly I want him to be.&nbsp;</p> <p>Finally it’s our senior year and we’re months away from never having to see each other again when disaster strikes - and brings us closer together. All it takes is one touch, and I’m burning for Ash. Hotter than I ever have.&nbsp;</p> <p>But will that burn turn into a devastating fire? Or can we actually make it work this time?</p>"; 
